import React, { Component } from "react";
import "./Mentor.css";

class Mentor extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="mentor">
        <h1>Connect with your mentor</h1>
        <p>
          Have any questions about your course? Approach your personal tutor and
          get your doubts clarified. Your question will be emailed to your
          respective tutor's email
        </p>
      </div>
    );
  }
}

export default Mentor;
